import 'antd/dist/antd.css';
import { Button, Radio } from 'antd';
import { DownloadOutlined } from '@ant-design/icons';

function App() {
  return (
    <div className="App">
      <header className="App-header">

      </header>
      <body>
        <div className="Container">
          <div className="Arrow1"></div>
          <div className="Top">
            <h1 className="T1">
              <Row><Col span={24}>Le Top</Col></Row>
            </h1>
            <h1 className="T2">
              <Row>
              <Col span={12}></Col>
              <Col span={12}>du Top !</Col>
              </Row>
            </h1>    
            <div className="cd">
              <img src={cdtop}></img>
            </div>    
            <div className="Welcome">
              <p>Bienvenue sur Spoty, le tracker Spotify par excellence ! Consultez l’intégralités de vos données Spotify grâce à notre API en quelques clicks.
              <br/>Bonne découverte !<br/></p>
              <button type="button">Je découvre!</button>
            </div>  

          </div>
        </div>

      </body>
    </div>
  );
}

export default App;
